const COLORS = {
    white: '#fff',
    dark: '#000',
    red: '#F52A2A',
    light: '#F1F1F1',
    green: '#00B761',
    yellow: '#eac9b2',
    lightblue: '#dce7f6',
    placeorder: "#DA81F5",
};

export default COLORS;
